graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="value__key" align="left" balign="left">value</td><td port="value__value" align="left" balign="left">{{ config.count + 1 }}</td></tr><tr><td port="value__key_1" align="left" balign="left">value</td><td port="value__value_1" align="left" balign="left">{{ config.enabled ? 'yes' :<BR/>'no' }}</td></tr><tr><td port="value__key_2" align="left" balign="left">value</td><td port="value__value_2" align="left" balign="left">#computedValue</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces


}
